                    return alert("Użytkownik poprawnie zalogowany.")
                    setState({isLoggedIn: true})

                } else {
                    return alert("dupa")
                }

    }

    return (<>

            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <div className={classes.paper}>
                    <form className={classes.form} noValidate>
                        <TextField
                            variant="outlined"
                            margin="normal"
                            required
                            fullWidth
                            id="email"
                            label="Adres Email"
                            name="email"
                            autoComplete="email"
                            autoFocus
                            value={state.email}
                            onChange={event => setState({
                                ...state,
                                email: event.target.value
                            })}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            required
                            fullWidth
                            name="password"
                            label="Hasło"
                            type="password"
                            id="password"
                            autoComplete="current-password"
                            value={state.password}
                            onChange={event => setState({
                                ...state,
                                password: event.target.value
                            })}
                        />
                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            color="primary"

                            className={classes.submit}
                            onClick={event => onClickSignIn(event, state.email, state.password)}
                        >
                            Zaloguj Się
          </Button>
                        <Grid container>
                        </Grid>
                    </form>
                </div>
            </Container>
    </>);
}
